import React from 'react';
import imgTable from '../assets/cycles_status_table.JPG';
import './CycleTable.css';




const CycleTable=(props)=>{

    let view=null;
    let rows= props.data.map((row)=>{return(
        <tr>
            <td>{row.ID}</td>
            <td>{row.Description}</td>
            <td>{row.Ex_Running}</td>
            <td>{row.Ex_Pending}</td>
            <td>{row.Ex_completed}</td>
        </tr>)
    });

    if (props.data.length>0)
    {

        view = <div>
            <table className="ui small table">
                <thead>
                <tr>
                    <th>Cycle_Id</th>
                    <th>Cycle Name</th>
                    <th>Running Executions</th>
                    <th>Pending Executions</th>
                    <th>Completed Pass</th>
                </tr>
                </thead>
                <tbody>
                    {rows}
                </tbody>
                <tfoot>
                <tr>
                    <th>1</th>
                    <th></th>
                    <th>13</th>
                    <th>2</th>
                    <th>0</th>
                    <th>1</th>
                </tr>
                </tfoot>
            </table>
        </div>
    }
    else{
        view='loading....';
    }
    return(
        <div className="ui small table">
            {view }
        </div>
    )
}

export default CycleTable;
